import React from 'react'
import styled from 'styled-components'

const Container = styled.div`
  h1{
      text-align: center;
      padding-top: 140px
  }
`

const PullRequest = () => {
    return (
        <Container>
             <h1>PullRequest</h1>
        </Container>

    )
}

export default PullRequest
